VALID = [('(',')', 3) , ('[',']', 57), ('{', '}', 1197), ('<', '>', 25137)]

def run(data):
    results = 0
    valid_open = [x[0] for x in VALID]
    valid_close = [x[1] for x in VALID]

    for row in data:
        stack = []
        for index in range(len(row)):
            symbol = row[index]
            if symbol in valid_open:
                stack.append(row[index])
            elif symbol in valid_close:
                valid_index = valid_close.index(symbol)
                if valid_open[valid_index] == stack[-1]:
#                    print("Good")
                    stack.pop()
                else:
                    print(f"BAD {symbol} = {VALID[valid_index][2]}")
                    results += VALID[valid_index][2]
                    break
 #               print (f"{symbol}")
            else:
                print(f"unknown char {symbol}")
    return results

if __name__ == "__main__":
    results = run(DATA)
    print (results)
